window.onload=(()=>{Array.from(document.querySelectorAll("img[class~=cobo-static], img[class~=cobo-hover]")).forEach(e=>{let o=document.createElement("div"),l=e.cloneNode(!0);e.replaceWith(o),o.appendChild(e),e.classList.contains("cobo-static")?l.style.filter="blur(8px)":e.classList.contains("cobo-hover")&&(e.onmouseover=(()=>l.style.filter="blur(8px)"),e.onmouseout=(()=>l.style.filter="blur(0px)")),o.appendChild(l),e.style.position="absolute",e.style.zIndex="1"})});